import { factory } from '@flashcards/client'

const loginWithProvider = factory.createLoginWithProvider()
const getTopics = factory.createGetTopics()
const addTopic = factory.createAddTopic()
const removeTopic = factory.createRemoveTopic()

export { loginWithProvider, getTopics, addTopic, removeTopic }
